import React from 'react';
import { product } from '../../data';

function ProductTable(props) {
  const products = props.data.product.map(product => {
    return product;
  });
  const category = products.map(data => {
    return console.log(data.category);
  })
  // console.log(category)
  return(
    <table className="product-table">
      <thead>
        <tr>
          <th>Name</th>
          <th>Price</th>
        </tr>
        <tr>
          <th colSpan="2">

          </th>
        </tr>
      </thead>
      {products.map((data, index) => {
        {/* console.log(data) */}
          return (
            <tbody>
              <tr>
                <th key={index}>{data.category}</th>
              </tr>
              <tr>
                <td>{data.name}</td>
                <td>{data.price}</td>
              </tr>
            </tbody>
          )
        })}
    </table>
  )
}

export default ProductTable;
